import React, { useState} from "react";
import {  registerUser} from "../../services/";
const ModalCrearUsuario = ({ mostrar, onClose, onSuccess }) => {
    const [formData, setFormData] = useState({
        nombre: "",
        email: "",
        contrasena: "",
        rol: "CLIENTE", // Rol predeterminado
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

   const handleSubmit = async (e) => {
           try {
               await registerUser(formData); // Llama al servicio para crear un usuario
               onSuccess(); // Recarga la lista de usuarios
                onClose(); // Cierra el modal
           } catch (error) {
               if (error.response && error.response.data) {
                   if (typeof error.response.data === "object") {
                       // Procesar mensajes de error de validación
                       const errores = Object.values(error.response.data).join(" ");
                       setError(errores);
                   } else {
                       // Manejar mensajes generales
                       setError(error.response.data.message || "Error desconocido.");
                   }
               } else {
                   setError("Ocurrió un error al registrar el usuario. Por favor, inténtelo de nuevo.");
               }
           }
       };

    if (!mostrar) return null;

    return (
        <div className="fixed inset-0 bg-gray-900 bg-opacity-50 flex items-center justify-center">
            <div className="bg-white p-6 rounded shadow-md w-96">
                <h2 className="text-xl font-bold mb-4">Añadir Usuario</h2>
                {error && <p className="text-red-500 mb-4">{error}</p>}
                <form onSubmit={handleSubmit}>
                    <div className="mb-4">
                        <label htmlFor="nombre" className="block font-semibold mb-1">
                            Nombre
                        </label>
                        <input
                            type="text"
                            id="nombre"
                            name="nombre"
                            value={formData.nombre}
                            onChange={handleChange}
                            className="w-full border border-gray-300 p-2 rounded"
                            required
                        />
                    </div>
                    <div className="mb-4">
                        <label htmlFor="email" className="block font-semibold mb-1">
                            Email
                        </label>
                        <input
                            type="email"
                            id="email"
                            name="email"
                            value={formData.email}
                            onChange={handleChange}
                            className="w-full border border-gray-300 p-2 rounded"
                            required
                        />
                    </div>
                    <div className="mb-4">
                        <label htmlFor="contrasena" className="block font-semibold mb-1">
                            Contraseña
                        </label>
                        <input
                            type="password"
                            id="contrasena"
                            name="contrasena"
                            value={formData.contrasena}
                            onChange={handleChange}
                            className="w-full border border-gray-300 p-2 rounded"
                            required
                        />
                    </div>
                    <div className="mb-4">
                        <label htmlFor="rol" className="block font-semibold mb-1">
                            Rol
                        </label>
                        <select
                            id="rol"
                            name="rol"
                            value={formData.rol}
                            onChange={handleChange}
                            className="w-full border border-gray-300 p-2 rounded"
                        >
                            <option value="ADMINISTRADOR">Administrador</option>
                            <option value="RECEPCIONISTA">Recepcionista</option>
                            <option value="PROFESIONAL">Profesional</option>
                            <option value="CLIENTE">Cliente</option>
                        </select>
                    </div>
                    <div className="flex justify-end space-x-2">
                        <button
                            type="button"
                            onClick={onClose}
                            className="bg-gray-500 text-white py-2 px-4 rounded hover:bg-gray-600"
                        >
                            Cancelar
                        </button>
                        <button
                            type="submit"
                            className="bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-600"
                        >
                            Guardar
                        </button>
                    </div>
                </form>
            </div>
        </div>
    );
};
export default ModalCrearUsuario;
